It's relatively clear how to define a union type, but how can we work with a union type? Consider the following function: function logTaskName(taskName: string | undefined) { console.log({ taskName, taskNameLength: taskName.length, });
} This will result in the following error: index.ts:4:21 - error TS18048: 'taskName' is possibly 'undefined'.
4 taskNameLength: taskName.length, ~~~~~~~~
Found 1 error in index.ts:4 TypeScript will only allow to do something with the value of a union type if that something is valid for every member of the union. Since taskName can be either a string or undefined, we can't call .length on it! Instead we need to narrow the type: function logTaskName(taskName: string | undefined) { if (taskName !== undefined) { console.log({ taskName, taskNameLength: taskName.length, }); } else { console.log('the task is not defined'); }
} We narrow the type of taskName in the taskName !== undefined branch. TypeScript can inspect the control flow and realize that since taskName had the string | undefined type and taskName !== undefined in the truthy branch of the if statement, taskName must be of type string inside that branch. Narrowing can be done by using typeof, checking truthiness of values or with equality checks x === y.

