A particularly important union type is the discriminated union . This is a union where a property is used to discriminate between union members. Consider the following classical example: type Square = { kind: 'square'; size: number;
}; type Rectangle = { kind: 'rectangle'; width: number; height: number;
}; type Shape = Square | Rectangle; We can now narrow values of the discriminated union based on the discriminant property (which in this case is kind): function getArea(shape: Shape) { if (shape.kind === 'square') { return shape.size * shape.size; } else { return shape.width * shape.height; }
}

