Generics allow us to write code that is independent of specific types. Consider the example of retrieving the first element of an array: function getFirstElement(arr) { return arr[0];
} How would we type this? We could use any: function getFirstElement(arr: any): any { return arr[0];
} However using any is bad since we lose all the type information even if we pass in an array of a known type. We could also make use of function overloads and write something like this: function getFirstElement(arr: number[]): number;
function getFirstElement(arr: string[]): string;
function getFirstElement(arr: undefined[]): undefined;
// More overloads and implementation here But this obviously gets very tedious and error-prone the more we do it. Instead TypeScript allows us to use generics to specify that we don't really care about a type.

