Often, we don't want to pass completely arbitrary type parameters. For example we might want to ensure that the variable we pass has the length property. We can't just use it though, since this will lead to an error. Consider this example: function printLength<Type>(arg: Type): number { return arg.length;
} This will throw the following error: index.ts:2:14 - error TS2339: Property 'length' does not exist on type 'Type'.
2 return arg.length; ~~~~~~
Found 1 error in index.ts:2 This makes sense since arg can be of literally any type and there is no guarantee that arg will actually have the property length. To change this, we need to constrain the type Type: function printLength<Type extends { length: number }>(arg: Type): number { return arg.length;
} As usual, we can use a type alias here: type HasLength = { length: number;
}; function printLength<Type extends HasLength>(arg: Type): number { return arg.length;
}

