Conceptually, a component is an independent and reusable piece of the UI. By thinking about an HTML page in terms of isolated components you can easily create well-designed pages. Consider the first version of the easy-opus app. We will need to display a bunch of tasks. Every task should be its own component containing the task summary, description and a button to delete the task. These tasks are grouped in a task list component. In addition to the tasks, the task list component has a button to add a new task. This is how it would look like in an image: In terms of implementation, a component is just a JavaScript function that takes the data it should render as input and returns the UI representation of the data as output. It will probably not come as a surprise to you at this point that the returned UI representation is given by JSX. Do note that all the code we are about to write goes between the <script> tags. We will fix this in the next section. Let us move the task list into its own component: const TaskList = () => { return ( <div id="taskList"> <p>Read the MERN book: Read and understand the MERN book.</p> <p>Write a website: Create a new and cool website.</p> </div> );
}; Hooray! You created your first React component. Ok, now you can definitely add React to your resume. No? Well, apparently you are really one of those weird people who actually learn things before putting them on their resume... We could now call the TaskList component the same way we would call a regular JavaScript function. We could also wrap it in a React.createElement call. However thanks to the power of JSX we can just do this: const app = ( <div id="app"> <h1>Tasks</h1> <TaskList /> </div>
); This looks just as if <TaskList> is a regular HTML tag! This means that we can use and nest our own components exactly like we would use and nest HTML elements. This leads to very simple code that is describing our UI in a very concise and straightforward manner. This is why you should not confuse HTML and JSX. It's much more complicated (and relatively rare) to add your own custom tags in HTML. In comparison - creating custom components in JSX is easy and you will do so often. Isn't that great? Hint: It totally is .

