}; You can hopefully see how the concepts from chapter 1 all come together quite nicely. Excellent! We can use the new component like this: const tasks = [ { id: 'TSK-1', summary: 'Read the MERN book', description: 'Read and understand the MERN book.', }, { id: 'TSK-2', summary: 'Write a website', description: 'Create a new and cool website.', },
