You've already encountered the Number data type: const age = 20;
console.log(typeof age); // number Any integer or real number is a Number: console.log(typeof 42); // number
console.log(typeof -20); // number
console.log(typeof 3.4); // number
console.log(typeof -1.7); // number You can perform arithmetic on numbers using the usual arithmetic operators +, -, * and /. There is also the % (modulo) operator which returns the remainder of a division. Finally, there is the ** operator which does exponentiation: const a = 3;
const b = 4;
console.log(a + b); // 7
console.log(a - b); // -1
console.log(a * b); // 12
console.log(a / b); // 0.75
console.log(a % b); // 3
console.log(a ** b); // 81 You can also use the shorthand assignment operators to combine asssignment and arithmetic operators: let a = 3;
a += 4;
console.log(a); // 7
a -= 2;
console.log(a); // 5
a *= 3;
console.log(a); // 15
a /= 3;
console.log(a); // 5
a %= 3;
console.log(a); // 2
a **= 5;
console.log(a); // 32 You also use the postfix increment and the postfix decrement operators to increment or decrement a value by 1: let a = 4;
a++;
console.log(a); // 5
a--;
console.log(a); // 4 So far, so obvious. However there are also some other things which have type Number like Infinity. Infinity is a special value that represents mathematical infinity: console.log(typeof Infinity); // number Additionally there is a special value called NaN (short for "not a number"). For example the result of 0 / 0 is NaN: console.log(0 / 0); // NaN Hilariously enough, NaN itself is a number. This is despite the fact that its name literally says that it isn't: console.log(typeof NaN); // number Don't let that confuse you. Another important thing about numbers is that you need to be careful when you are trying to perform operations with real numbers. For example if you add 0.1 and 0.2 you get a weird result: console.log(0.1 + 0.2); // 0.30000000000000004 This is not the fault of JavaScript, but instead has to do with the limitations of trying to represent real numbers in binary on a finite hardware. We will not go into great detail in this book about this problem. If you're interested in more details we encourage you to have a look at the IEEE754 standard.

