fetch(url).then((response) => console.log(response)); This will log the response object we get from https://jsonplaceholder.typicode.com/todos/1 to the console (we will learn how to deal with this response object in a second). We can rewrite the above example in a more explicit manner: const url = 'https://jsonplaceholder.typicode.com/todos/1';
const fetchPromise = fetch(url);
fetchPromise.then((response) => console.log(response));
console.log(fetchPromise); This is what happens: We call fetch which immediately returns a pending promise. We pass a handler function into the then method. The handler function will be called when the fetch succeeds (i.e. the promise returned by fetch is fulfilled). After a while the fetch succeeds, fetchPromise is fulfilled and the response object is logged. It is important to note fetch returns immediately. The return value of fetch is a pending promise (that will eventually settle with either a response value or some kind of error). This is why console.log(fetchPromise) is executed before console.log(response) and you see the following output in the console: Promise { <pending> }
Response { ...
} Additionally the then method also returns immediately, after it has attached the handler function to the fetchPromise. However the execution of the handler function happens only after the promise returned by fetch is fulfilled. On one hand this is what we want - while we are waiting for the network request to complete, we can do other stuff (like logging fetchPromise). On the other hand this is the reason why asynchronous programming is often so confusing to beginners - it "breaks" the regular programming model. When we write synchronous code, we just execute statements one after another. With asynchronous code this is no longer the case - here we "register" a function to be executed later, do something else, and then at some point the registered function is executed.

