TypeScript also has the any type. When a value is of "any" type, you can access its properties, call it, or assign it freely, and basically do anything (get it?) that's syntactically correct. Let's say you have a task variable of type any - then these are all legal: console.log(task.summary);
task();
const otherTask = task; Basically any is way to tell the compiler to "shut up" and skip type checking. This is also the reason why using any is generally a terrible idea since it defeats the purpose of using TypeScript in the first place! However sometimes you do find yourself in a situation where you don't know much about a variable type. In this case it's better to use unknown. If you have a task variable of type unknown, then these are all no longer legal: console.log(task.summary);
