A union type is a type that represents a value which may be one of multiple values. Consider the type TaskState which represents one of the following states: Todo InProgress Done Here is how we would defined the TaskState type: type TaskState = 'Todo' | 'InProgress' | 'Done'; The TaskState type is a union type and each of the literal types 'Todo', 'InProgress' and 'Done' is a member of the union. A variable of type TaskState can only be of one of these literal types, i.e. it can only have one of the respective values. For example these are all valid: const state: TaskState = 'Todo';
const state2: TaskState = 'InProgress';
const state3: TaskState = 'Done'; But this is not: const invalidState: TaskState = 'Dropped';
